import {
  GET_ISS_LOCATION,
} from '../actions';

const INITIAL_ISS_LOCATION_STATE = {
  latitude: -20.950199,
  longitude: -48.478931,
  error: null,
  isLoading: false, 
}

function issLocation(state = INITIAL_ISS_LOCATION_STATE, action) {
  switch(action.type) {
    case 'ACTION':
      return state;
    default:
      return state;
  }
}

export default issLocation;
